import { Col, Row } from 'reactstrap';
import Cart from './components/Cart/index';
import CheckOutForm from './components/Checkout/CheckOutForm';

const checkout = () => {
  return (
    <Row>
      <Col>
        <h1>チェックアウト</h1>
        <Cart></Cart>
      </Col>
      <Col>
        <CheckOutForm />
      </Col>
    </Row>
  );
};

export default checkout;
